                           {next: null,flag : true, id: "25", image: 'https://i.pinimg.com/550x/b0/ac/ce/b0acce2169a511b6775f684cb28a027c.jpg'},                         
                           {next: null,flag : true, id: "29", image: 'https://i.pinimg.com/550x/b0/ac/ce/b0acce2169a511b6775f684cb28a027c.jpg'}
                         ],
                currentId : 0        
            }
    }

    render() {
        return (

            <>

                <GridSystem colCount={5} rowcount={6}>          
                    {this.state.conection}                                             
                </GridSystem>
              
                {/* <DrawArrows>
                    {this.state.conection}
